import React from 'react'
import Movie from './Movie'


const MovieList = (props) => {

    return (
        <>
            {props.movies.map((movie, MovieAPI)=> 
            <div>
                <img src={movie.Poster} alt='movie'></img>

            </div>)}
        </>

    )

}

export default MovieList;



